const { default: styled } = require('styled-components');

export const Container = styled.div`
  display: flex;
  margin: 35px;
  overflow-x: scroll;

`;

export const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  min-width: 300px;
  margin-right: 15px;
  flex: 1;

`;
